import { useEffect, useState } from 'react'
import axios from 'axios';

const [DATA, setData] = useState([]);
useEffect(() => {
  const fetchData = async () => {
    const result = await axios.get('/api/products');
    console.log(result);
    setData(result.data);
  };
  fetchData();
}, []);


// export default products;
